import React from 'react';

export const Header = () => {
  return (
    <div className='logo'>
      <a href="http://www.sel.eesc.usp.br/lio/" target="_blank" rel="noopener noreferrer">
        <img src="../images/lab_ocular.png" width="100vw" alt="LIO logo"/>
      </a>
    </div>
  );
}
